import React from "react";
import { useAxios } from "../hooks/useAxios";

const Reports = () => {
  const axiosInstance = useAxios();
  const [reports, setReports] = React.useState([]);

  React.useEffect(() => {
    axiosInstance.get("reports/").then((response) => setReports(response.data));
  }, []);

  return (
    <div>
      {reports.map((report) => (
        <div key={report.id}>
          <p>{report.title}</p>
          <p>{report.content}</p>
        </div>
      ))}
    </div>
  );
};

export default Reports;
